import React from "react";
import NewsContainer from "../components/NewsContainer";

const Showbookmarks = (props) => {
    return (
        <div>
            {props.bookmarks.length > 0 ? (
                <div className="album py-5 bg-body-tertiary">
                <div className="row row-cols-1 row-cols-sm-2 row-cols-md-3 g-3">
                    {props.bookmarks.map((bookmark) => (
                        <NewsContainer
                            key={bookmark._id}
                            _id={bookmark._id}
                            title={bookmark.title}
                            description={bookmark.description}
                            url={bookmark.url}
                            urlToImage={bookmark.urlToImage}
                            publishedAt = {bookmark.publishedAt}
                        />
                    ))}
                </div>
                </div>
            ) : (
                <div className='server-main'>
                    <img src="images\nothing.png" alt="....." className="server-img-main" />
                </div>
            )}
            <img src="images\arrow.png" alt="....." onClick={()=>{props.setcontainer('main')}}/>
            <p className="card-text" onClick={()=>{props.setcontainer('main')}}>Go Back</p>
        </div>
    );
};

export default Showbookmarks;
